/*
Switching Between Pencils
When coloring a striped pattern, you may start by coloring each square sequentially, 
meaning you spend time needing to switch coloring pencils.
Create a function where given an array of colors cols, 
return how long it takes to color the whole pattern. Note the following times:

It takes 1 second to switch between pencils.
It takes 2 seconds to color a square.
See the example below for clarification.

color_pattern_times(["Red", "Blue", "Red", "Blue", "Red"]) âžž 14

// There are 5 colors so it takes 2 seconds to color each one (2 x 5 = 10).
// You need to switch the pencils 4 times and it takes 1 second to switch (1 x 4 = 4).
// 10 + 4 = 14

Examples
colorPatternTimes(["Blue"]) âžž 2
colorPatternTimes(["Red", "Yellow", "Green", "Blue"]) âžž 11
colorPatternTimes(["Blue", "Blue", "Blue", "Red", "Red", "Red"]) âžž 13

Notes
1) Only change coloring pencils if the next color is different to the color before it.
2) Return a number in seconds.
*/

function colorPatternTimes(cols) {
  const timeToColorSquare = cols.reduce((acc, value, idx, arr) => {
    acc += 2;
    if (arr[idx] !== arr[idx + 1] && idx < arr.length - 1) {
      acc += 1;
    }
    return acc;
  }, 0);
  console.log('timeToColorSquare ~ timeToColorSquare: ðŸ‘†ðŸ‘†ðŸ‘†ðŸ‘†ðŸ‘†ðŸ‘†ðŸ‘†', timeToColorSquare);
}

